import React from 'react';
import { Offcanvas } from 'react-bootstrap';

const StoreSettingsSidebar = ({ show, handleClose, children }) => {
  return (
    <Offcanvas show={show} onHide={handleClose} placement="end">
      <Offcanvas.Header closeButton>
        <Offcanvas.Title>Store Settings</Offcanvas.Title>
      </Offcanvas.Header>
      <Offcanvas.Body className="p-0"> {/* Remove default padding */}
        {children}
      </Offcanvas.Body>
    </Offcanvas>
  );
};

export default StoreSettingsSidebar;
